edition = "2023";

package youtube.api.innertube;

import "youtube/api/innertube/formatted_string.proto";

option java_package = "com.google.protos.youtube.api.innertube";
option java_multiple_files = true;
option cc_enable_arenas = true;
option objc_class_prefix = "YTI";

message VideoReportActionResultRenderer {
	FormattedString response_message = 1;
	FormattedString issue_reported_title = 2;
	FormattedString issue_reported_text = 3;
	FormattedString timestamp_title = 4;
	FormattedString timestamp_text = 5;
	FormattedString additional_details_title = 6;
	FormattedString additional_details_text = 7;
}
